  true,\n\t\"url\": null,\n\t\"notes\": \"PoroTomo March 2016 (Task 6.4) Updated vibroseis
  source locations with UTM locations. Supersedes gdr.openei.org/submissions/824.
  Updated vibroseis source location data for Stages 1-4, PoroTomo March 2016. This
  revision includes source point locations in UTM format (meters) for all four Stages
  of active source acquisition.nnVibroseis sweep data were collected on a Signature
  Recorder unit (mfr Seismic Source) mounted in the vibroseis cab during the March
  2016 PoroTomo active seismic survey Stages 1 to 4.  Each sweep generated a GPS timed
  SEG-Y file with 4 input channels and a 20 second record length.   Ch1 = pilot sweep,
  Ch2 = accelerometer output from the vibe's mass, Ch3 = accel output from the baseplase,
  and Ch4 = weighted sum of the accelerometer outputs.  SEG-Y files are available
  via:   ftp://roftp.ssec.wisc.edu/porotomo/PoroTomo/DATA/Vibroseis/Stage1_segys/nftp://roftp.ssec.wisc.edu/porotomo/PoroTomo/DATA/Vibroseis/Stage2_segys/nftp://roftp.ssec.wisc.edu/porotomo/PoroTomo/DATA/Vibroseis/Stage3_segys/nftp://roftp.ssec.wisc.edu/porotomo/PoroTomo/DATA/Vibroseis/Stage4_segys/\",\n\t\"owner_org\":
